import Fruit from "./Fruit";

const array = ["Apple", "Banana", "Orange"];
function App() {
  return (
    <>
      {array.map((frt, ind) => {
        <Fruit num={ind} name={frt} />;
      })}
    </>
  );
}

export default App;
